import React from 'react';

import Dayslot from '../Dayslot/Dayslot.jsx'

import './DayTable.scss';

export default function DayTable(props) {

    let dayslots = []

    for (let i = 6; i <= 24; ++i) {
        timeslots.push(
            <Dayslot key={i} time={i} />
        )
    }

    return (
        <>
            {props.day}
            {dayslots}
        </>
    );
}
